import { NavLink } from "react-router-dom";
import "./navbar.css";

const Navbar = () => {
  return (
    <>
      <header className="header">
        <nav className="navContainer">
          <NavLink to="/" className="nav__logo">
            Navigation Bar
          </NavLink>
        </nav>
      </header>
    </>
  );
};

export default Navbar;
